import React from 'react';
import { Grid, Segment, Icon } from 'semantic-ui-react';

export const Links = () => {
  return (
    <Grid.Row style={{ padded: '20px' }} stretchd justified>
      <Icon name='twitter' size='massive'></Icon>
      <Icon name='instagram' size='massive'></Icon>
      <Icon name='soundcloud' size='massive'></Icon>
      <Icon name='bandcamp' size='massive'></Icon>
    </Grid.Row>
  );
};

export default Links;
